import React, { useEffect, useState } from 'react';
import axios from 'axios';

function CustomersList() {
  const [customers, setCustomers] = useState([]);

  useEffect(() => {
    axios.get('http://127.0.0.1:8000/api/customers')
      .then(response => setCustomers(response.data))
      .catch(error => console.error(error));
  }, []);

  return (
    <div>
      <h2>Lista Klientów</h2>
      <table className="table">
        <thead>
          <tr>
            <th>ID</th>
            <th>Imię</th>
            <th>Nazwisko</th>
            <th>Miasto</th>
            <th>Ulica</th>
            <th>Email</th>
          </tr>
        </thead>
        <tbody>
          {customers.map(customer => (
            <tr key={customer.klient_id}>
              <td data-label="ID">{customer.klient_id}</td>
              <td data-label="Imię">{customer.imie}</td>
              <td data-label="Nazwisko">{customer.nazwisko}</td>
              <td data-label="Miasto">{customer.miasto}</td>
              <td data-label="Ulica">{customer.ulica}</td>
              <td data-label="Email">{customer.email}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}

export default CustomersList;
